import React, { Component } from "react"
import { Layout } from "~/components/Layout/Layout"
import Card from '../components/card/card'

import { stateTop, stateMasked } from '../state/state'

export default class extends Component {

  topToProps() {
    return stateTop.map((item, index) => {
      return (
        <div className={`col ${item.className}`} key={index}>
          <Card {...item.cardProps}/>
        </div>
      )
    })
  }

  maskedToProps() {
    return stateMasked.map((item, index) => {
      return (
        <div className={`col ${item.className}`} key={index}>
          <Card {...item.cardProps}/>
        </div>
      )
    })
  }

  render() {
    return (
      <Layout>
        <div className="container">
          <h2 className="headers mb--more-small">ТОП <span className="italic">10</span> мест</h2>

          <div className="row">
            { stateTop && this.topToProps()}
          </div>

          <h2 className="headers mb--more-medium mt--big"><span className="italic">Скоро</span> на сайте</h2>

          <div className="row">
            { stateMasked && this.maskedToProps()}
          </div>
        </div>
      </Layout>
    )
  }
}
